const repository=new Repository("Cliente");$(function(){$("#guardar").on("click",function(){let n={nombre:$("#nombre").val(),apellidoPaterno:$("#apellidoPaterno").val(),apellidoMaterno:$("#apellidoMaterno").val()};repository.httpPost("Guardar",n).then(n=>{n.correct?success("Registro exitoso","El cliente fue registrado correctamente",`/Cliente/Detalles/${n.data.clienteID}`):requestError(n.message)}).catch(n=>{serviceError(`${n.status} - ${n.statusText}`)})})});